(ii) determination of whether the promised goods and services are performance obligations, including whether they are distinct in the context of the contract;
(iii) measurement of the transaction price, including the constraint on variable consideration;
(iv) allocation of the transaction price to the performance obligations; and
(v) recognition of revenue when (or as) the Company satisfies each performance obligation. The Company adopted ASU 2014-09, Revenue from Contracts with Customers (Topic 606). Under Topic 606, the Company records revenue when persuasive evidence of an arrangement exists, delivery has occurred, the fee is fixed or determinable and collectability is probable. The Company records revenue from the sale of product upon shipment or delivery of the products to the customer. The Company doesn’t allow return of the products purchased or refund unless the food delivered is spoilt.

Level 1 : Observable inputs such as quoted prices in active markets;
Level 2 : Inputs, other than the quoted prices in active markets, that are observable either directly or indirectly; and
Level 3 : Unobservable inputs in which there is little or no market data, which require the reporting entity to develop its own assumptions. As of December 31, 2023 and 2022, the Company did not have any nonfinancial assets and liabilities that are recognized or disclosed at fair value in the financial statements, at least annually, on a recurring basis, nor did the Company have any assets or liabilities measured at fair value on a non-recurring basis.
